  summary: "Предоставляет прослушиватель, который направляет все трассировки и отладки для [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] инфраструктуру."
  remarks: "Класс IisTraceListener подключается механизм трассировки [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] для [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)]. Этот класс прослушивателя позволяет разработчикам, создающим [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] приложений и кто реализовать <xref:System.Web.IHttpModule>и <xref:System.Web.IHttpHandler>интерфейсы для создания уровня страницы, модуль или обработчик событий для [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] инфраструктуру, когда трассировка включена.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule>      Настроек [!NOTE] настроек класс прослушивателя не направляет [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] событий для классов ASP.NET. Сюда входят <xref:System.Web.UI.Page>классов и классов, реализующих <xref:System.Web.IHttpModule>или <xref:System.Web.IHttpHandler>интерфейса.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule> </xref:System.Web.UI.Page>       IisTraceListener впервые появился в [!INCLUDE[net_v35_long](~/add/includes/ajax-current-ext-md.md)]. Дополнительные сведения см. в разделе [версии и зависимости](~/add/includes/ajax-current-ext-md.md)."
